  \"2013-03-15T23:13:38.887767\",\n\t\"name\": \"hydrologic-reconnaissance-of-the-northern-great-salt-lake-desert-and-summary-hydrologic-reconna\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The northern Great Salt Lake Desert is
  an area of about 2,100 square mi les in the central part of northwestern Utah. Average
  annual precipitation ranges from about 4.5 to slightly more than 12 inches; total
  annual precipitation is estimated to average about 620,000 acre-feet. Runoff is
  scanty and reaches the desert floor only during or immediately after thunderstorms
  and periods of rapid snowmelt. Drainage is internal except for the part of the area
  immediately adjacent to Great Salt Lake. Surface outflow to Great Salt Lake is estimated
  to average less that 500 acre-feet annually.\",\n\t\"license_title\": null,\n\t\"extras\":
